import SidebarProvider from "./contexts/SidebarContext";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
    <SidebarProvider>
        <ProductProvider>
            <React.StrictMode>
                <App />
            </React.StrictMode>
        </ProductProvider>
    </SidebarProvider>

);
